import Card from './Card';
import './CardList.css';


const CardList = ({data}) => {
	const list = data.map((user , i)=> {
		return <Card robots={data[i]}/>;
	});
	return (

		<div id ='cards' >
			{list}
		</div>

	);
}

export default CardList;
